package voting

import (
	"strconv"
	"time"

	"gno.land/p/moul/md"
	"gno.land/p/nt/ufmt"
)

// Render("")        -> list of all proposals
// Render("id/<ID>") -> details of one proposal

func Render(path string) string {
	if path == "" {
		return renderIndex()
	}

	parts := splitPath(path)
	if len(parts) == 2 && parts[0] == "id" {
		return renderProposal(parts[1])
	}

	return "404"
}

// in-order through all proposals AVL
func renderIndex() string {
	out := md.H1("Voting dApp") + "\n"

	if proposals.Size() == 0 {
		out += "No proposals yet.\n\n"
		out += md.CodeBlock(`CreateProposal("My idea", 10)  // duration in minutes`)
		return out
	}

	proposals.Iterate("", "", func(key string, value any) bool {
    		prop := value.(*Proposal)
    		out += renderProposalLine(prop)
    		return false // false = continue iteration; true = stop
	})
	return out
}

func renderProposalLine(p *Proposal) string {
	status := "OPEN"
	if time.Now().After(p.Deadline) {
		status = "CLOSED"
	}

	return md.Paragraph(
		md.Bold(ufmt.Sprintf("#%d", int(p.ID))) + " " +
			p.Text + "  " +
			"["+status+"]\n" +
			"-> " + md.Link("details", "/r/demo/voting:id/"+p.ID.String()),
	)
}

func renderProposal(id string) string {
	raw, ok := proposals.Get(id)
	if !ok {
		return md.H2("Proposal not found")
	}
	p := raw.(*Proposal)

	yes, no, closed := GetResult(id)
	status := "OPEN"
	if closed {
		status = "CLOSED"
	}

	out := md.H2(ufmt.Sprintf("Proposal #%d", int(p.ID)))
	out += md.Blockquote(p.Text) + "\n"
	out += "Author: " + p.Author.String() + "\n\n"
	out += "Created: " + p.CreatedAt.Format("02 Jan 2006 15:04") + "\n\n"
	out += "Deadline: " + p.Deadline.Format("02 Jan 2006 15:04") + "\n\n"
	out += "Status: " + status + "\n\n"

	out += md.H3("Results: ") + "YES = " + strconv.Itoa(yes) + "\n\nNO = " + strconv.Itoa(no) + "\n\n"

	out += md.HorizontalRule()

	out += md.CodeBlock(
		`// create:
CreateProposal("My first proposal", 10)

// vote yes:
Vote("` + id + `", true)

// vote no:
Vote("` + id + `", false)`,
	)
	return out
}

// util: split string '/'
func splitPath(path string) []string {
	var parts []string
	start := 0
	for i := 0; i < len(path); i++ {
		if path[i] == '/' {
			if start < i {
				parts = append(parts, path[start:i])
			}
			start = i + 1
		}
	}
	if start < len(path) {
		parts = append(parts, path[start:])
	}
	return parts
