)

// ---------- STATE & TYPES ----------

var (
	// all proposals: key = seqid.ID.String(), val = *Proposal
	proposals = avl.NewTree()

	// proposal sequental last ID
	lastID seqid.ID

	// Errors
	ErrEmptyText    = errors.New("empty proposal text")
	ErrBadDuration  = errors.New("duration must be > 0 minutes")
	ErrNotFound     = errors.New("proposal not found")
	ErrAlreadyVoted = errors.New("address already voted")
	ErrVotingClosed = errors.New("voting window is closed")
)

// Single proposal
type Proposal struct {
	ID        seqid.ID
	Text      string
	Author    std.Address
	CreatedAt time.Time
	Deadline  time.Time
	Yes       int
	No        int

	// map of the voters: key = address.String(), val = bool (true=yes, false=no)
	Voters *avl.Tree
