package voting

import (
	"std"
	"time"

	"gno.land/p/nt/avl"
)

// creates proposal with time limit in minutes
// returns id of the created proposal
func CreateProposal(_ realm, text string, durationMinutes int) (string, error) {
	if text == "" {
		return "", ErrEmptyText
	}

	if durationMinutes <= 0 {
		return "", ErrBadDuration
	}

	id := lastID.Next()
	prop := &Proposal{
		ID:        id,
		Text:      text,
		Author:    std.PreviousRealm().Address(),
		CreatedAt: time.Now(),
		Deadline:  time.Now().Add(time.Minute * time.Duration(durationMinutes)),
		Yes:       0,
		No:        0,
		Voters:    avl.NewTree(),
	}

	proposals.Set(id.String(), prop)
	return id.String(), nil
}

// vote - yes (support == true) or no (support == false) for given proposal id
func Vote(_ realm, id string, support bool) error {
	raw, ok := proposals.Get(id)
	if !ok {
		return ErrNotFound
	}

	prop := raw.(*Proposal)

	// check time limit
	// time.Now() is the transaction block time
	if time.Now().After(prop.Deadline) {
		return ErrVotingClosed
	}

	// one vote per address (should be improved - eg. to be token-weighted)
	addrStr := std.PreviousRealm().Address().String()
	if _, exists := prop.Voters.Get(addrStr); exists {
		return ErrAlreadyVoted
	}

	prop.Voters.Set(addrStr, support)
	if support {
		prop.Yes++
	} else {
		prop.No++
	}
	return nil
}

// returns (yes, no, closed)
func GetResult(id string) (int, int, bool) {
	raw, ok := proposals.Get(id)
	if !ok {
		return 0, 0, true
	}
	prop := raw.(*Proposal)
	closed := time.Now().After(prop.Deadline)
	return prop.Yes, prop.No, closed
}

